(window.webpackJsonp=window.webpackJsonp||[]).push([[63],{1212:function(e,o){e.exports={domain:"messages",locale_data:{messages:{"":{domain:"messages",plural_forms:"nplurals=2; plural=(n > 1)",lang:"fr_CA"},"Search for anyone":["Recherche quelqu\u2019un "],"Type in a name":["Entrez le nom d\u2019une personne pour la trouver."],"This has no exclamation marks":["Bienvenue \xe0 la validation de principe d\u2019Annuaire!"],"Self-serve contact information":["Mise \xe0 jour en libre-service de vos coordonn\xe9es"],"Easily update your contact information so that it is always accurate. You can make changes yourself and they will show up immediately.":["Vous pouvez facilement mettre \xe0 jour vos coordonn\xe9es afin de veiller \xe0 ce qu\u2019elles demeurent exactes! Vous pouvez apporter les changements vous-m\xeame, et ils seront imm\xe9diatement affich\xe9s dans votre profil."],"Easy to search":["Recherche facile"],"Looking for someone? Quickly find other members and start collaborating.":["Vous cherchez quelqu\u2019un? Trouvez facilement d\u2019autres employ\xe9s pour commencer \xe0 collaborer avec eux."],"Clean and simple profile":["Profil simple et soign\xe9"],"Your profile is yours to complete. Add a profile photo to make it personal.":["Cr\xe9ez votre propre profil et ajoutez une photo de profil pour y mettre votre touche personnelle!"],"Create teams":["Cr\xe9ation d\u2019\xe9quipes"],"Supervisors can create teams and self-manage members.":["Les superviseurs peuvent cr\xe9er des \xe9quipes et en g\xe9rer les membres."],"Organizational chart":["Organigramme"],"Explore an entire team and find the exact person you need to talk to.":["Examinez l\u2019organisation d\u2019une \xe9quipe enti\xe8re et trouvez la personne \xe0 qui il vous faut parler."],"New interface design":["Nouvelle apparence de l\u2019interface"],"A bright-blue colour scheme, rounded elements and minimalist look make the application just a little more fun to use.":["La palette de couleurs ax\xe9e sur le bleu vif, l\u2019\xe9quilibre des \xe9l\xe9ments visuels et l\u2019aspect sobre et minimaliste rendent l\u2019application un peu plus plaisante \xe0 utiliser."],"Key features":["Principaux \xe9l\xe9ments"],"What\u2019s coming next?":["\xc0 venir prochainement\u2026"],"This is the first version of the Directory but we have big plans for the future. Below is a list of some features we have planned for development.":["Il ne s\u2019agit l\xe0 que de la premi\xe8re it\xe9ration d\u2019Annuaire \u2013 nous avons de grands desseins pour l\u2019application. Vous trouverez ci-dessous une liste de fonctionnalit\xe9s dont la conception est pr\xe9vue pour l\u2019avenir."],"Please note that all these features are subject to change, as future features and improvements will depend on your feedback.":["Veuillez noter que ces fonctionnalit\xe9s pourraient \xeatre modifi\xe9es, car les fonctionnalit\xe9s et les am\xe9liorations mises en oeuvre \xe0 l\u2019avenir d\xe9pendront de vos commentaires!"],"How to provide your feedback":["Pour fournir vos commentaires"],"We want your feedback to help us improve Directory and priorities new features to be developed. Before telling us what you think, play around and test out the new design and functionality of Directory. Take note of what you like, don\u2019t like, and suggestions for improvement.":["Nous avons besoin de vos commentaires pour nous aider \xe0 am\xe9liorer l\u2019Annuaire et \xe0 \xe9tablir le degr\xe9 de priorit\xe9 des nouvelles fonctionnalit\xe9s \xe0 mettre sur pied. Avant de nous faire part de vos commentaires, examinez la nouvelle esth\xe9tique d\u2019Annuaire et mettez \xe0 l\u2019essai ses fonctions. Relevez ce qui vous pla\xeet et ce qui vous d\xe9pla\xeet, et prenez en note vos suggestions pour am\xe9liorer l\u2019Annuaire."],"We will be hosting user testing and feedback sessions where you can share what you\u2019ve discovered. Join the (x) GCcollab group and keep an eye out for the next research session on Directory.":["Nous organiserons des s\xe9ances d\u2019essai et de r\xe9troaction aupr\xe8s des utilisateurs o\xf9 vous pourrez faire part de vos d\xe9couvertes. Joignez-vous au groupe dans GCcollab et ne manquez surtout pas la prochaine s\xe9ance de recherche sur l\u2019Annuaire."],"All about the details":["Tout est dans les d\xe9tails"],"This application is in its early stages. As a proof of concept, this application is not a finalized product ready for full use. It\u2019s meant to be a first version with base features so that you can add your contact info, explore, and provide your feedback.":["Cette application n\u2019en est encore qu\u2019\xe0 ses d\xe9buts! \xc9tant \xe0 l\u2019\xe9tape de validation de principe, cette application n\u2019est pas un produit fini pr\xeat \xe0 \xeatre utilis\xe9 pleinement. Il s\u2019agit plut\xf4t d\u2019une premi\xe8re it\xe9ration munie des fonctions de base o\xf9 vous pouvez fournir vos coordonn\xe9es. Vous pouvez l\u2019explorer et fournir vos commentaires."],"As a functional prototype, this application is set for user testing and exploration. We will be running user testing and feedback sessions soon, so play around and take note of what you like, what you don\u2019t, and suggestions for improvement. See below for more information on how you can provide your feedback.":["\xc9tant un prototype fonctionnel, l\u2019application est destin\xe9e \xe0 la mise \xe0 l\u2019essai et \xe0 l\u2019exploration par les utilisateurs. Nous organiserons bient\xf4t des s\xe9ances d\u2019essai et de r\xe9troaction aupr\xe8s des utilisateurs. Entre-temps, examinez les fonctionnalit\xe9s de l\u2019application, relevez ce qui vous pla\xeet et ce qui vous d\xe9pla\xeet, et prenez en note vos suggestions pour am\xe9liorer l\u2019Annuaire. Vous trouverez ci-dessous des renseignements sur la mani\xe8re de fournir vos commentaires."],"Because this is a proof of concept, there will be bugs in the system. If you come across a bug, don\u2019t worry. We\u2019ll be fixing bugs on a regular basis as we develop new features and improvements.":["Puisqu\u2019il ne s\u2019agit que d\u2019une validation de principe, le syst\xe8me comprendra des erreurs. Si vous en rencontrez un, ne vous inqui\xe9tez pas! Nous r\xe9parerons r\xe9guli\xe8rement ces erreurs au fur et \xe0 mesure que nous d\xe9velopperons de nouvelles fonctionnalit\xe9s et am\xe9liorations."],"NOTE:":["REMARQUE :"],"This application currently uses fake content so that we could accurately display certain features, such as the organizational chart. Approximately 12,000 users were randomly generated to add data to the application and show a realistic sample.":["\xc0 l\u2019heure actuelle, l\u2019application contient de \xab faux profils \xbb de remplissage qui ne correspondent \xe0 aucun utilisateur r\xe9el. Nous les avons ajout\xe9s afin de pouvoir bien pr\xe9senter certaines fonctionnalit\xe9s, telles que les organigrammes. Environ 12 000 faux profils d\u2019utilisateurs ont \xe9t\xe9 g\xe9n\xe9r\xe9s de mani\xe8re al\xe9atoire afin de remplir l\u2019application de donn\xe9es et afficher un \xe9chantillon repr\xe9sentatif du nombre r\xe9el d\u2019employ\xe9s."],"As we onboard more departments, and more public servants complete their profile, we will remove the fake content.":["Au fur et \xe0 mesure que davantage de minist\xe8res participent au projet et que de plus en plus de fonctionnaires cr\xe9ent des profils, nous \xe9liminerons les faux profils."],"Automatic profile creation when you register for GCaccount, which includes your name and email address.":["Cr\xe9ation automatique d\u2019un profil contenant votre nom et votre adresse courriel au moment o\xf9 vous vous inscrivez \xe0 GCcompte."],"Approval workflow that allows supervisors to approve requests for team members and employees.":["Flux d\u2019approbation qui permet aux superviseurs d\u2019approuver les demandes des membres de leurs \xe9quipes et de leurs employ\xe9s."],"In-app notifications for items that require your attention (approvals, change requests, etc.)":["Avis envoy\xe9 par l\u2019application au sujet des activit\xe9s qui requi\xe8rent votre attention (approbations, demandes de modification, etc.)."],"Ability to choose team avatars and colours":["Capacit\xe9 de choisir un avatar et une couleur pour repr\xe9senter une \xe9quipe enti\xe8re."],"Enhanced search functionality":["Fonction de recherche am\xe9lior\xe9e."],"One-time profile transfer from GCcollab to Directory":["Migration ponctuelle des profils de GCcollab \xe0 l\u2019Annuaire."],"Integrating non-government accounts and users into Directory":["Int\xe9gration des comptes et des utilisateurs de l\u2019ext\xe9rieur du gouvernement \xe0 l\u2019Annuaire."],"Give us your Feedback":["Donnez-nous vos commentaires"],"Made with Aurora":["Cr\xe9\xe9 en utilisant Aurora"],"Welcome block text":["Vous \xeates parmi les premiers \xe0 consulter la validation de concept de la nouvelle application Annuaire. N'h\xe9sitez pas \xe0 y jeter un coup d'\u0153il. Vous ne pouvez pas vous connecter pour l'instant, mais d'autres mises \xe0 jour seront bient\xf4t disponibles!"]}}}}}]);
